import React from 'react';
import { useLoader } from '@react-three/fiber';
import { TextureLoader } from 'three';

const Panel = () => {
  const albedo = useLoader(TextureLoader, '/textures/leather/brown_leather_albedo_4k.jpg');

  return (
    <group>
      <mesh position={[0, -1, -7]}>
        <boxGeometry args={[36, 23, 0.5]} />
        <meshStandardMaterial map={albedo} />
      </mesh>
    </group>
  );
};

export default Panel;
